  console.log(videogames);

  const renderGames = videogames.map((games) => {
    return (
      <div key={games.id}>
        <img src={games.image} alt='img' />
        <h3>{games.name}</h3>
        <h3>{games.genres.map(genre)}</h3>

      </div>
    );
  });

  return <div>{renderGames}</div>;
}

export default Home;
